import ReactAnime from 'react-animejs'
import { useState } from 'react';

function App() {
  const [num, setNum] = useState(5)
  const { Anime } = ReactAnime;

  const vw = Math.max(document.documentElement.clientWidth, window.innerWidth);
  console.log(vw);

  return (
    <div className="App">
      <Anime
        initial={[
          {
            targets: ".sky",
            translateX: 50,
            easing: "linear"
          }
        ]}
      >
        <svg className="sky">
          <circle
            cx="50"
            cy="50"
            r="40"
            stroke="green"
            stroke-width="4"
            fill="yellow"
          />
        </svg>
      </Anime>
    </div>
  );
}

export default App;
